class CourseQuery {
  des: string;
  cNum: string;
  creditCode: string;  // H|Y
  sectionCode: string;  // F|S|Y


  /**
   * Returns a list of possible ways to query, or
   * blank if it can't for some reason.
   */
  getAllQueries(): string[] {
    if(this.des === "" || this.cNum === ""){
      return [];
    }
    const cc = this.des + this.cNum;
    if(this.creditCode === "" && this.sectionCode === ""){
      return [
        cc + "H1-F",
        cc + "H1-S",
        cc + "Y1-Y",
        cc + "H1-Y",
        cc + "Y1-F",
        cc + "Y1-S"
      ];
    }

    // know H/Y, IDK F/S/Y
    if(this.creditCode !== "" && this.sectionCode === ""){
      // console.log("I know the credit code" + this.creditCode);
      if(this.creditCode === "Y"){
        return [
          cc + "Y1-Y",
          cc + "Y1-F",
          cc + "Y1-S"
        ]
      } else {
        return [
          cc + "H1-F",
          cc + "H1-S",
          cc + "H1-Y"
        ]
      }
    }

    // know F/S/Y, IDK H/Y
    else {
      if(this.sectionCode === "Y"){
        return [
          cc + "Y1-Y",
          cc + "H1-Y"
        ]
      } else {
        return [
          cc + "H1-" + this.sectionCode,
          cc + "Y1-" + this.sectionCode
        ]
      }
    }
    

  }

  /**
   * The constructor for this class.
   * By minimum, crs must match the regex
   * [A-Z]{3}[0-9]{3}.*
   * 
   * @param crs the course code
   */
  constructor(crs: string){
    crs = crs.replace(" ", "").toUpperCase().trim();
    // console.log(crs);
    if(!crs.match(/^[a-zA-Z]{3}[0-9]{3}.*/)){
      this.des = "";
      this.cNum = "";
      this.sectionCode = "";
      this.creditCode = "";
      return;
    }
    this.des = crs.substring(0, 3);
    this.cNum = crs.substring(3, 6);

    if(crs.match(/^[A-Z]{3}[0-9]{3}[HY]\d?-?[FYS]+$/)){
      // know both codes
      // console.log("I know both HY and FYS");
      this.creditCode = crs[6];
      this.sectionCode = crs[crs.length - 1];
    }  // Know: [HY], Don't know: [FSY]
    else if(crs.match(/^[A-Z]{3}\d{3}[HY]\d?-?$/)){
      // console.log("I know HY");

      this.creditCode = crs[6];
      this.sectionCode = "";  // unknown section code
    } else if (crs.match(/^[A-Z]{3}\d{3}\d?-?[FYS]+/)){
      // console.log("I know FYS");
      // Know: [FSY], Don't know: [HY]
      let match = crs.match(/^[A-Z]{3}\d{3}\d?-?[FYS]+/);
      let tempNewCrs = "";
      if(match !== null)
        tempNewCrs = match[0][match[0].length - 1];
      else tempNewCrs = crs;
      this.sectionCode = tempNewCrs[tempNewCrs.length - 1];
      this.creditCode = "";
    }
    else {
      // console.log("I know neither");
      this.sectionCode = "";
      this.creditCode = "";
    }
  }

}
